int subarraysDivByK(vector<int>& A, int K) {
        int n=A.size();
        int local=0;
        int count=0;
        if(n==1){
            if(A[0]%K==0)
                return 1;
            else
                return 0;
        }
        for(int i=0;i<n;i++){
            local=0;
            for(int j=i;j<n;j++){
                local+=A[j];
                if(local%K==0)
                    count++;
            }
            
        }
        return count;
    }

